import React, { useState } from "react";

import img from "../../assets/images/page_img/11.jpg";

import Signupcreate from "./Signupcreate";
import SignupformC from "./SignupformC";
import Signupphone from "./Signupphone";
import SignupformP from "./SignupformP";
import "./signup.css";

const SignupCreateForm = () => {
  const [form, setForm] = useState(false);
  const [phone, setPhone] = useState(false);
  const [main, setMain] = useState(true);

  function onChaneToFormPage(type) {
    if (type === "next") {
      setForm(true);
    } else {
      setMain(false);
    }
  }
  function updateMain() {
    setMain(false);
    setPhone(false);
  }

  async function onChaneToPhonePage(type) {
    console.log(type);
    if (type === "complete") {
      const a = await updateMain();
    } else if (type === "next") {
      setPhone(true);
    }
  }


  return (
    <section>
      {phone && main? (
        <div className="row" id="signup">
          <div className="col-md-6 signup-img"></div>

          <div className="col-md-6 signup-div-p">
            <SignupformP phoneForm={onChaneToPhonePage} />
          </div>
        </div>
      ) : (
        <div className="row" id="signup">
          <div className="col-md-6 signup-img"></div>
          <div className="col-md-6 signup-div">
            <Signupphone phoneForm={onChaneToPhonePage} />
          </div>
        </div>
      )}
      {!form ? (
        <div className="row" id="signup">
          <div className="col-md-6 signup-img"></div>

          <div className="col-md-6 signup-div">
            <Signupcreate formPage={onChaneToFormPage} />
          </div>
        </div>
      ) : (
        <div className="row" id="signup">
          <div className="col-md-6 signup-img"></div>

          <div className="col-md-6 signup-div">
            <SignupformC formPage={onChaneToFormPage} />
          </div>
        </div>
      )}
    </section>
  );
};

export default SignupCreateForm;
